import React from 'react';
import './ShopTab.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCogs, faTags, faCar, faMoneyBill  } from '@fortawesome/free-solid-svg-icons';

function ShopTab(){
    return(
        <div className='shoptab-wrapper'>
            <div className='shoptab-icons-wrapper'>
                <FontAwesomeIcon icon={faCogs} color={'rgb(204, 0, 0)'} className='shoptab-icon'></FontAwesomeIcon>
                <FontAwesomeIcon icon={faTags} color={'rgb(204, 0, 0)'} className='shoptab-icon'></FontAwesomeIcon>
                <FontAwesomeIcon icon={faCar} color={'rgb(204, 0, 0)'} className='shoptab-icon'></FontAwesomeIcon>
                <FontAwesomeIcon icon={faMoneyBill} color={'rgb(204, 0, 0)'} className='shoptab-icon'></FontAwesomeIcon>
            </div>
            <div className='shoptab-links-wrapper'>

            </div>
        </div>
    )
}

export default ShopTab;
